What follows is a thorough dissection of each file in the archive, starting with the RVU file.

## RVU

The pdf labeled "RVU" is a comprehensive guide to the structure and contents of each file in the Relative Value zip file. It describes the methodology, that contains a data dictionary, record layout, and documentation




::: {.cell layout-align="center"}

```{.r .cell-code}
rvu24a <- rbrvs::get_source(year = 2024, source = "pprrvu")$rvu24a_jan |> 
  dplyr::mutate(
    mod = cheapr::factor_(mod),
    status_code = cheapr::factor_(status_code),
    pctc_ind = cheapr::factor_(pctc_ind),
    glob_days = cheapr::factor_(glob_days),
    mult_proc = cheapr::factor_(mult_proc),
    bilat_surg = cheapr::factor_(bilat_surg),
    asst_surg = cheapr::factor_(asst_surg),
    co_surg = cheapr::factor_(co_surg),
    team_surg = cheapr::factor_(team_surg),
    physician_supervision_of_diagnostic_procedures = cheapr::factor_(physician_supervision_of_diagnostic_procedures),
    diagnostic_imaging_family_indicator = cheapr::factor_(diagnostic_imaging_family_indicator),
    )

over <- cheapr::overview(rvu24a, hist = TRUE)

hcpcs_row <- over$categorical |> 
  dplyr::select(variable = col, value = n_unique) |> 
  dplyr::filter(variable == "hcpcs")
```
:::





