## PPRVU

The MPFS is a listing of the relative value units (RVUs) for each CPT code, as well as the geographic practice cost index (GPCI) for each code. The RVUs are used to calculate the payment amount for each service, while the GPCI is used to adjust the payment amount based on the location where the service is provided.

This file contains information on services covered by the MPFS in 2024. For more than 10,000 physician services, the file contains the associated RVUs, a fee schedule status indicator, and various payment policy indicators needed for payment adjustment (i.e., payment of assistant at surgery, team surgery, bilateral surgery, etc.).

The MPFS amounts are adjusted to reflect the variation in practice costs from area to area. A GPCI has been established for every Medicare payment locality for each of the three components of a procedures RVU: 

  1. Physician Work
  1. Practice Expense
  1. Malpractice Expense (sometimes called Professional Liability Insurance)

The GPCIs are applied in the calculation of a fee schedule payment amount by multiplying the RVU for each component times the GPCI for that component.

### Participating

$$ x = [(RVU_w \times GPCI_w) + (RVU_p \times GPCI_p) + (RVU_m \times GPCI_m)] \times CF $$

### Non-Participating

$$ y = 0.95x $$

### Limiting Charge

$$ z = 0.95(1.15x) $$

::: callout

## Many Ways to Say the Same Thing

<br>

As there is a corresponding GPCI value for each of the three components of an RVU, the formula is essentially the [dot product](https://www.toppr.com/guides/maths-formulas/dot-product-formula/) of the RVU and GPCI vectors, multiplied by the conversion factor:

<br>

$$ a \cdot b = a_1b_1 + a_2b_2 + a_3b_3$$
<br>

Setting up the variables:




::: {.cell layout-align="center"}

```{.r .cell-code  code-fold="false"}
wrvu  = 6.26   # Work RVU
wgpci = 1      # Work GPCI

pgpci = 0.883  # Practice GPCI
prvu  = 4.36   # Practice RVU

mrvu  = 0.99   # Malpractice RVU
mgpci = 1.125  # Malpractice GPCI

cf    = 32.744 # Conversion Factor
```
